  CONSTRAINT `FK_order_seller_id` FOREIGN KEY (`seller_id`) REFERENCES `member_seller` (`uid`),
  CONSTRAINT `FK_order_together_delivery_order_id` FOREIGN KEY (`together_delivery_order_id`) REFERENCES `order` (`uid`)
